import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ContractTypeManagement = () => {
  const [types, setTypes] = useState([]);
  const [form, setForm] = useState({
    id: '',
    name: '',
    code: '',
    description: '',
  });
  const [editMode, setEditMode] = useState(false);
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetchTypes();
  }, []);

  const fetchTypes = async () => {
    const res = await axios.get('http://localhost:8080/contract_types');
    setTypes(res.data);
  };

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      if (editMode) {
        await axios.put(`http://localhost:8080/contract_types/${form.id}`, form);
        setMessage('Updated successfully.');
      } else {
        await axios.post('http://localhost:8080/contract-types', form);
        setMessage('Created successfully.');
      }
      setForm({ id: '', name: '', code: '', description: '' });
      setEditMode(false);
      fetchTypes();
    } catch (err) {
      setMessage('Operation failed.');
    }
  };

  const handleEdit = type => {
    setForm(type);
    setEditMode(true);
  };

  const handleDelete = async id => {
    if (window.confirm('Are you sure?')) {
      try {
        await axios.delete(`http://localhost:8080/contract-types/${id}`);
        fetchTypes();
      } catch {
        setMessage('Deletion failed. It may be in use.');
      }
    }
  };

  return (
    <div className="p-6 bg-white shadow rounded-lg">
      <h2 className="text-2xl font-bold mb-4">Contract Type Management</h2>
      {message && <p className="text-green-600 mb-2">{message}</p>}
      <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-4">
        <input type="text" name="name" placeholder="Name" value={form.name} onChange={handleChange} required className="border p-2 rounded" />
        <input type="text" name="code" placeholder="Code" value={form.code} onChange={handleChange} className="border p-2 rounded" />
        <textarea name="description" placeholder="Description" value={form.description} onChange={handleChange} className="col-span-2 border p-2 rounded" />
        <button type="submit" className="col-span-2 bg-indigo-600 text-white px-4 py-2 rounded">
          {editMode ? 'Update' : 'Add'} Contract Type
        </button>
      </form>
      <table className="w-full border">
        <thead>
          <tr className="bg-gray-100">
            <th className="p-2 border">Name</th>
            <th className="p-2 border">Code</th>
            <th className="p-2 border">Description</th>
            <th className="p-2 border">Actions</th>
          </tr>
        </thead>
        <tbody>
          {types.map(type => (
            <tr key={type.id} className="hover:bg-gray-50">
              <td className="p-2 border">{type.name}</td>
              <td className="p-2 border">{type.code}</td>
              <td className="p-2 border">{type.description}</td>
              <td className="p-2 border flex gap-2">
                <button onClick={() => handleEdit(type)} className="bg-yellow-500 text-white px-2 py-1 rounded">Edit</button>
                <button onClick={() => handleDelete(type.id)} className="bg-red-600 text-white px-2 py-1 rounded">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ContractTypeManagement;
